import Link from "next/link"

export default function Layout(props){
  return ( 
    <div>
      <div id="navbar" style={{ width: '100%', padding: '10px 10px', position: 'absolute', top: '0', left: '0'}}>
        <h2>JDanielS</h2>

        <div id="links">
          <Link href="/"><a>Home</a></Link>
        </div>
      </div>
      <div id="content" style={props.style}>
        {props.content}
      </div>
    </div>
  )
}
